<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>IT Company Landing Page</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #f8f8f8;
            color: #333;
        }

        header {
            background-color: #333;
            color: #fff;
            padding: 10px 20px;
            text-align: center;
        }

        .container {
            max-width: 1200px;
            margin: 20px auto;
            padding: 0 20px;
        }

        h1 {
            font-size: 2.5em;
            margin-bottom: 20px;
            text-align: center;
        }

        p {
            font-size: 1.2em;
            line-height: 1.6;
            text-align: center;
            margin-bottom: 20px;
        }

        .button {
            display: inline-block;
            padding: 10px 20px;
            background-color: #333;
            color: #fff;
            text-decoration: none;
            border-radius: 5px;
            transition: background-color 0.3s;
        }

        .button:hover {
            background-color: #555;
        }

        footer {
            background-color: #333;
            color: #fff;
            text-align: center;
            padding: 10px 0;
            position: absolute;
            bottom: 0;
            width: 100%;
        }

        .services {
            display: flex;
            justify-content: center;
            margin-top: 40px;
        }

        .service {
            margin: 0 20px;
            text-align: center;
        }

        .service img {
            max-width: 100%;
            border-radius: 10px;
            margin-bottom: 10px;
        }
    </style>
</head>

<body>
    <header>
        <h1>Welcome to our IT Company</h1>
        <p>Your one-stop solution for all IT needs</p>
        <a href="#" class="button">Learn More</a>
    </header>

    <div class="container">
        <h2>About Us</h2>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vitae commodo tellus. Donec dictum auctor mauris, ac hendrerit enim ultricies sed. Nulla facilisi.</p>

        <h2>Our Services</h2>
        <div class="services">
            <div class="service">
                <img src="data:image/jpeg;base64," alt="Web Development">
                <p>Web Development</p>
            </div>
            <div class="service">
                <img src="data:image/jpeg;base64," alt="Mobile App Development">
                <p>Mobile App Development</p>
            </div>
            <div class="service">
                <img src="data:image/jpeg;base64," alt="IT Consulting">
                <p>IT Consulting</p>
            </div>
        </div>
    </div>

    <footer>
        &copy; 2024 IT Company. All Rights Reserved.
    </footer>
</body>

</html>
